import { GenreButton } from './GenreButton.js';
function Genre( props ) {

    const [ display, setDisplay ] = useState( 'none' )

    function handleClick() {

        if ( display == 'none' ) {

            setDisplay( 'block' )

        } else {

            setDisplay( 'none' )

        }

    }

    return (

        <div>



            <div style={{display:display}}>

                { props.children }

            </div>

        </div>

    )

}

export { Genre }
